    e.preventDefault();
  }
  return (
    <div className="App">
      {status ? <h1>hello</h1>:null}

      <button onClick={()=>setStatus(!status)}>toggle</button>
     <form onSubmit={getFormData}>
     <h1 className='text-center'>form</h1>
