      <option>dc</option>
     </select><br></br>
     <input type="checkbox" onChange={(e)=>setInterest(e.target.checked)} /><span>accept terms and conditions</span>
     <button type="submit">submit</button>
     </form>

    </div>
  );
}

export default App;
